import neptuneImg from "../../src/assets/img/monstersAvatars/Neptune.png";

const monsters = [
  {
    id: 1,
    name: "Neptune",
    life: 100,
    img: neptuneImg,
    attack: 1,
    strength: 1,
    speed: 1,
    dexterity: 1,
    doodge: dexterity,
    accuracy: 1,
  },
];

export default monsters;
